"use strict";exports.id=1471,exports.ids=[1471],exports.modules={35629:e=>{e.exports=JSON.parse('{"summary":"CyFoundry 的 Phalanx 已對您網路基礎設施安全狀態做了深入檢查，並提供掃描報告。另透過使用先進的掃描方法，該報告能準確找出潛在的漏洞和安全缺陷，這些漏洞和缺陷可能會被對手用於惡意目的。","severity":"通用漏洞評分系統 (CVSS) 是一個標準化框架，用於評估軟體安全漏洞的嚴重性。通過評估漏洞的關鍵屬性，CVSS 會計算分數以反映其嚴重程度。這個分數有助於規劃響應方式和緩解措施，使組織可依據漏洞對系統或整體組織所構成的風險來處理這些漏洞。","Report Generation time":"報告生成時間","Scan Start Time":"掃描開始時間","Scan End Time":"掃描結束時間","Total Vulnerabilities":"漏洞總數","Total Scaned Hosts":"掃描主機總數","Total Scaned Ports":"掃描埠總數","Total Scaned Services":"掃描服務總數","Footer":"此文件可能包含特權或機密資訊。因此，未經發件人明確書面同意，不得披露、複製、分發或使用\\n。本文件僅供收件人個人或實體使用。如果您不是預定的收件人，請注意，嚴禁審查、傳播、分發\\n或複製本文件。","SUMMARY":"摘要","Summary Content":"Phalanx已對目標系統或網路基礎設施安全狀態進行全面分析，並提供掃描報告。利用先進的掃描方法，報告能夠\\n識別出可能被惡意行為者利用的潛在漏洞和安全缺陷。","SCAN RESULT":"掃描結果","Scan Result Content":"通用漏洞評分系統 (CVSS) 是一個標準化框架，用於評估軟體安全漏洞的嚴重性。通過評估漏洞的關鍵屬性，CVSS\\n會計算分數以反映其嚴重程度。這個分數有助於規劃響應方式和緩解措施，使組織可依據漏洞對系統或整體組織所\\n構成的風險來處理這些漏洞。","Endpoint Scan":"端點掃描","Hostname":"主機名稱","MAC Address":"MAC位址","IP Address":"IP位址","Ports":"端口","Test Range":"測試範圍","Test Range Content":"針對本次掃描的範圍，我們區分成掃描出弱點跟沒有掃瞄出弱點的IP，並將有掃瞄出弱點的IP，列出他的最高風險\\n等級。","Test Range Content 2":"未檢測到的IP，以及在指定範圍內未檢測/掃描的IP。","Tested":"已掃描數","Unsuccessful":"不成功總數","Successful":"成功總數","BAS VALIDATION RESULT":"BAS驗證結果","BAS VALIDATION RESULT Content":"BAS是一種安全測試方法，旨在模擬現實世界的攻擊情景以評估組織的安全防禦能力。這種測試方法通常使用自動化\\n工具來模擬各種攻擊，從網路入侵到惡意軟體感染，以幫助組織識別其系統中的漏洞和弱點。","BAS Validation":"BAS驗證","Success":"成功","IP address verified, no vulnerabilities found! Or no data available for this IP.":"IP地址已驗證，未發現漏洞！或是此IP內無資料","No Detected Vulnerabilities":"未偵測到漏洞","IP Not Detected":"未偵測到 IP","Vulnerabilities by Severity":"依嚴重程度分類的漏洞"}')}};